  handleClick = () => {
    // alert();
    // this.setState({
    //   brand: 'Maruti',
    //   model: 2020
    // });

    this.setState(function(state, props) {
      console.log(state);
    });
  };

  render() {
    return (
      <div>
        <h1>setSet Button Click change **</h1>
        <h3>
          My Car Brand :{this.state.brand} and model {this.state.model}
        </h3>
        <button onClick={this.handleClick}>!!Click to change!!</button>
      </div>
    );
  }
}
